import React from 'react';
import Game from './components/Game/index'
import './App.css';

function Home() {
  return (
    <div className="App">
    <h1>Weather Today</h1>

    <div className="input-div">
      <i className="fas fa-map-marker-alt"></i>
      <input
        ref={this.autocompleteInput}
        id="autocomplete"
        placeholder="Enter city name"
        type="text"
        className="searchBar"
      ></input>
      <i className="fas fa-search"></i>
    </div>

  </div>
  );
}

export default Home;
